//----------
//Components
//----------
import React, {Component} from 'react';
import '../styles/Art.css'

class Art extends Component {
  render() {
    return(

      <div className="main">
      <div className="art-banner">
       <div className="art-banner"></div>
       </div>
        <div className="art-card">
          <img source= {this.props.img}/>
          <div className="card-body">
            <h2 className="art-h">{this.props.title}</h2>
            <p className="art-p">Located in scenic Eden Park, the Cincinnati Art Museum features an unparalleled art collection of more than 67,000 works spanning 6,000 years. In addition to displaying its own broad collection, the Art Museum also hosts several national and international traveling exhibitions each year. The Rosenthal Education Center offers an immersive, hands-on experience for families.</p>
            <h5>{this.props.stars}</h5>
          </div>
        </div>
    
  </div>
    )
  }
}

class ArtCards extends Component {
  render() {
    return (
      <>
  
      
       <div className='art-cards'>
         <Art
          img='../img/holder1'
          title='Cincinnati Museum Center'
          stars='9 out of 10 stars' />
      </div>  
      </>
    )
  }
}

//----------
//Final render
//----------

export default (Art, ArtCards)
